&lt;tr&gt;&lt;td class='diff-marker'&gt;−&lt;/td&gt;&lt;td style=&quot;background: #ffa; color:black; font-size: smaller;&quot;&gt;&lt;div&gt;[[File:Logo_tekken6.png|left]][[Tekken 6]] is the eighth game in the Tekken franchise. It was released in Japanese arcades on November 26, 2007 as the first game running on the PlayStation 3-based System 357 arcade board.&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;[4] &lt;/del&gt;The game received an update, subtitled Bloodline Rebellion, a year later. A home version based on the update was released for Xbox 360 and PlayStation 3 in October 2009 and for PlayStation Portable a month later, but the console release is marketing simple as 'Tekken 6'.&lt;/div&gt;&lt;/td&gt;&lt;td class='diff-marker'&gt;+&lt;/td&gt;&lt;td style=&quot;background: #cfc; color:black; font-size: smaller;&quot;&gt;&lt;div&gt;[[File:Logo_tekken6.png|left]][[Tekken 6]] is the eighth game in the Tekken franchise. It was released in Japanese arcades on November 26, 2007 as the first game running on the PlayStation 3-based System 357 arcade board. The game received an update, subtitled Bloodline Rebellion, a year later. A home version based on the update was released for Xbox 360 and PlayStation 3 in October 2009 and for PlayStation Portable a month later, but the console release is marketing simple as 'Tekken 6'.&lt;/div&gt;&lt;/td&gt;&lt;/tr&gt;
